    false,nt"url": null,nt"notes": "This narrative report for Bowdoin NWR outlines
    Refuge accomplishments from January through April of 1955. The report begins by
    summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and collections and receipts.
    Resource management is outlined; topics include grazing and fur harvesting. The
    public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
